import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import styled from "styled-components";

function Login() {
  return (
    <Container>
      <p>Login</p>
      <Link to="/Empresa">About</Link>
      <p>Conteúdo da página</p>
    </Container>
  );
}
const Container = styled.div`
  display: flex;
  height: 100%;
  background: red;
  width: 100%;
`;
export default Login;
